import styled from 'styled-components';

export const HeaderProfileContainer = styled.div`
  background: var(--base-gray);
  min-height: 200px;
  position: fixed;
  width: 100%;
  z-index: 10;
  display: flex;
  align-items: center;
`;

export const GridContainer = styled.div`
  height: 100%;
  width: 100%;
  margin: auto;
`;

export const TitleContainer = styled.span`
  display: block;
  font-family: 'Gilroy-Bold';
  text-align: center;
  font-size: 24px;
  color: var(--primary-green);
`;

export const SubtitleContainer = styled.span`
  display: block;
  font-family: 'Gilroy-SemiBold';
  text-align: center;
  font-size: 14px;
  color: var(--base-gray-light);
`;

export const SearchIconContainer = styled.img`
  width: 24px;
  position: absolute;
  right: 16px;
  top: 10px;
  cursor: pointer;
`;

export const MenuIconContainer = styled.img`
  width: 24px;
  position: absolute;
  left: 16px;
  top: 10px;
  cursor: pointer;
`;
